import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="Homediv">
      <h1>시작 로고</h1>
      <img src="logo.png" alt="로고" />
      <p>3초만에 끝나는 간편한 출석체크</p>
      <Link to="/main">
        <button>로그인</button>
        <button>회원가입</button>
      </Link>
    </div>
  );
};

export default Home;
